import React from 'react';
import styled from 'styled-component';

const Div=styled.div`
  width:56px;
  height:56px;
  border-radius:50%;
  border:solid 2px red;
`
function StoryEle() {
  return (
    <Div><img src='images/activeStatus/photo.png'/></Div>
  );
}

export default StoryEle;
